For Copy types, it is easy to reuse previous storage calls by simply reusing the value, which is automatically cloned upon reuse. In the code below, the second call is unnecessary: pub fn increase_value_no_cache( origin: OriginFor<T>, some_val: u32,
) -> DispatchResultWithPostInfo { let _ = ensure_signed(origin)?; let original_call = <SomeCopyValue<T>>::get(); let some_calculation = original_call .unwrap() .checked_add(some_val) .ok_or("addition overflowed1")?; // this next storage call is unnecessary and is wasteful let unnecessary_call = <SomeCopyValue<T>>::get(); // should've just used `original_call` here because u32 is copy let another_calculation = some_calculation .checked_add(unnecessary_call.unwrap()) .ok_or("addition overflowed2")?; <SomeCopyValue<T>>::put(another_calculation); let now = <frame_system::Pallet<T>>::block_number(); Self::deposit_event(Event::InefficientValueChange(another_calculation, now)); Ok(().into())
} Instead, the initial call value should be reused. In this example, the SomeCopyValue value is Copy so we should prefer the following code without the unnecessary second call to storage: pub fn increase_value_w_copy( origin: OriginFor<T>, some_val: u32,
) -> DispatchResultWithPostInfo { let _ = ensure_signed(origin)?; let original_call = <SomeCopyValue<T>>::get(); let some_calculation = original_call .unwrap() .checked_add(some_val) .ok_or("addition overflowed1")?; // uses the original_call because u32 is copy let another_calculation = some_calculation .checked_add(original_call.unwrap()) .ok_or("addition overflowed2")?; <SomeCopyValue<T>>::put(another_calculation); let now = <frame_system::Pallet<T>>::block_number(); Self::deposit_event(Event::BetterValueChange(another_calculation, now)); Ok(().into())
}
